import Link from 'next/link';

const HeaderStyle = {
    display: "flex",
    flex: 1,
    background:"#141414",
    background:"#fff",
    height:"68px",
    alignItems:"center",
    justifyContent:"spaceAround"
}

const pageNameList = ([
    {id: 1, koName: "홈", enName:"/"},
    {id: 2, koName: "티비 프로그램", enName:"/TvProgram"},
    {id: 3, koName: "영화", enName:"/Movie"},
    {id: 4, koName: "최신 콘텐츠", enName:"/LatestContents"},
    {id: 5, koName: "티비 프로그램", enName:"/MyList"},
])

const pageName = pageNameList.map(pageNames=><li key={pageNames.id}><Link href={pageNames.enName}><a>{pageNames.koName}</a></Link></li>);


const Header = () => (
    
    <div style={HeaderStyle}>
        
            
                {pageName}

        
    </div>
)

export default Header;
